import React from 'react'

const QuickSelection = () => {

    const searches = [
        {
          from: "Siliguri",
          to: "Gangtok"
        },
        {
          from: "Siliguri",
          to: "BANGALORE"
        },
        {
          from: "BANGALORE",
          to: "CHENNAI"
        }
      ]
  return (

    
    <div className="max-w-7xl mx-auto p-6">
      <h2 className="text-2xl mb-6">Quick Searches :</h2>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        {searches.map((search, index) => (
          <div 
            key={index} 
            className="bg-white rounded-lg shadow-sm border border-gray-200 p-6"
          >
            <div className="min-h-[100px] flex flex-col justify-between">
              <h3 className="text-xl">
                {search.from} - {search.to}
              </h3>
              <div className="flex justify-end mt-4">
                <button className="text-lg hover:text-gray-700 transition-colors">
                  BOOK
                </button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  )
}

export default QuickSelection
